@app.route('/')
def get_random_pokemon_name():
    # Return the name of a random Pokemon character whose image can be found if no name is given.
    character_count = len(pokemon_list)
    random.seed()
    return pokemon_list[random.randint(0, character_count - 1)][0]

@app.route('/<name>')
def get_pokemon(name):

    # Return a string of character names comma separated if "characters" is sent.
    if name.lower() == 'characters':
        character_names = ''
        for item in pokemon_list:
            character_names += item[0] + ', '
        character_names = character_names[:-2]
        return character_names

    # Redirect to the image of the character if the name is given.
    for item in pokemon_list:
        if name.lower() == item[0].lower():
            return redirect(item[1], code=302)

    # Otherwise return default message.
    return "A message from CS361"
